   "source": [
    "# Side Yard Possum Project\n",
    "\n",
    "### This project is a work in progress. I'm recording the activity in my side yard using a trail cam. So far, I have included data from October 2022. I'm going to analyze it here.\n",
    "\n",
    "#### [Inspiration blog post](https://www.trailcamjunkie.com/the-moons-affect-on-deer-movement-10-years-of-trail-camera-data/)"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "9a42f905",
   "metadata": {
    "papermill": {
     "duration": 0.004119,
     "end_time": "2022-11-05T05:39:47.920218",
     "exception": false,
     "start_time": "2022-11-05T05:39:47.916099",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "## Background\n",
    "\n",
    "#### I am not a hunter. I originally got a trail cam to capture a cat. Next door to me lived a hoarder who had surrendered 19 dogs in July to the local humane society before moving out and abandoning the only animal he had left: a black and white cat who lived outside and had a habit of sleeping in the overturned trash can in the side yard between our houses.\n",
    "\n",
    "#### My partner and I had seen a black and white cat around and asked a few neighbors about it, since it was skittish and looked skinny - i.e. not owned.\n",
    "\n",
    "#### So after a few weeks of gathering information and trying to see if the cat would trust me by simply offering it food, I decided that the neighborhood was too dangerous for a stray cat for me to be patient and get its consent: I had to trap it. But when was it around?\n",
    "\n",
    "#### We had a couple photos of the cat from afar, all timestamped thanks to smartphone metadata, but the times were so scattered. But we don't have any windows to the side yard, and though I work from home, I didn't want to be getting up to check if there was a cat outside every 15 minutes. So I bought a cheap trail camera, set it up in the side yard, and waited.\n",
    "\n",
    "#### After the first night, I went out to pull the SD card and look at the photos. There were a few photos of the cat, but about 30 photos of possums of all sizes running back and forth throughout the night. We had never seen a possum around the neighborhood, so this was surprising and hilarious: a possum parade every night while we slept.\n",
    "\n",
    "#### So I borrowed a humane trap (photo) from the local humane society, bought a couple packets of tuna in oil, set the trap at 6pm according to trail cam data, and caught the cat within an hour.\n",
    "\n",
    "#### Long story short, his name is now Prospero, and his hobbies include tearing open tortilla bags, eating butter directly out of the (unattended) dish, and gently biting people's cheeks in the morning til he gets fed.\n",
    "\n",
    "add photo\n",
    "\n",
    "### But what about all the possum photos?\n",
    "\n",
    "#### After the cat was inside, it occurred to me that it'd be fun to see patterns of possum activity, and whoever else was in the side yard when I'm not looking. This is that project."
   ]
  },
