    "# Data Collection\n",
    "\n",
    "#### All data collection was conducted using [the cheapest non-cellular trail cam available at Academy](https://www.academy.com/p/muddy-outdoors-mtc100x-140-mp-trail-camera). It was placed about 1.5 feet off the ground and strapped to one of the fence posts of my backyard pointed at the side yard between my house and the unoccupied unit next door.\n",
    "\n",
    "#### During the October 2022 observation period, it remained in place 24/7 except for about 1 hour where we considered moving it, thought better of it, and then returned it to its original location."
   ]
  },
  {
