   "source": [
    "# Preparation\n",
    "\n",
    "First, I ran all the photos from October through [Exiftool](https://exiftool.org/) to gather metadata from my trail cam photos using these guides:\n",
    "* [Exiftool for Dummies](https://exiftool.org/dummies.html) (sure, laugh at me but it's a guide guide for those of us who don't know how to use the cmd console)\n",
    "* [Exiftool FAQ on How to Export to CSV](https://exiftool.org/faq.html#Q12ed)\n",
    "\n",
    "...and created a csv to use as a starting point.\n",
    "\n",
    "I then cleaned up two columns in my resulting csv that interpreted fraction values (exposure/shutter speed) as dates and converted them incorrectly.\n",
    "\n",
    "Next, I manually explored the photoset and coded by presence or absence of creatures and what type. This took some time, but I don't have time to learn machine learning right now. Perhaps another day. \n",
    "\n",
    "Some known data issues with the manually coded Creature column:\n",
    "* Unknown values due to creatures passing too close to the camera at night for a positive identification. (Include example)\n",
    "* None values due to \"false positive\" camera trips due to dappled light movements at sunset (example: 137) or intense rainfall (example: 129).\n",
    "* Human (household) anomalous burst of activity when we moved the camera and then moved it back to its original location. (photo of Aaron moving the camera?)"
   ]
  },
