    "# Analysis\n",
    "\n",
    "## Set-up\n",
    "\n",
    "#### There is a ton of metadata on what seems to be mostly a simple automatic digital camera that doesn't change from observation to observation.\n",
    "\n",
    "#### One thing I wish metadata captured is the moon phase, which the camera itself is aware of, but photo files do not include it. In later analysis, I may pull in weather statistics for my area and moon phases."
   ]
