   "source": [
    "# Formatting the dates and times, adding new columns\n",
    "\n",
    "images_202210$DateTimeNew <- as_datetime(images_202210$DateTimeOriginal) #format is YYYY:MM:DD HH:MM:SS\n",
    "images_202210$Month <- format(images_202210$DateTimeNew, \"%m\")\n",
    "images_202210$Day <- format(images_202210$DateTimeNew, \"%d\")\n",
    "images_202210$Year <- format(images_202210$DateTimeNew, \"%Y\")\n",
    "images_202210$Day_of_week <- format(images_202210$DateTimeNew, \"%A\") # Why not see if the possums are more active on Friday nights?\n",
    "images_202210$Hour <- format(images_202210$DateTimeNew, \"%H\")\n",
    "\n",
    "head(images_202210)\n",
    "\n",
    "# Cleaning up the edges and outliers. 202210 is meant to be October only\n",
    "\n",
    "clean_202210 <- images_202210[!(images_202210$Month != 10),] # Remove values outside October\n",
    "clean_202210$Creature.1 <- NULL # drop column Creature.1, which is empty\n",
    "\n",
    "head(clean_202210)\n",
    "\n",
    "dim(clean_202210) # How many observations for only October in the cleaned data?"
   ]
  },
