    "# Setting up a few data frames for subsets\n",
    "\n",
    "# All Creature values except for \"None\", the code for a false positive\n",
    "# (when the trail cam tripped but no creature was present)\n",
    "\n",
    "NoFalsePos <- clean_202210 %>%\n",
    "  filter(Creature != \"None\")\n",
    "\n",
    "# False positives only, by \"None\"\n",
    "\n",
    "FalsePos <- filter(clean_202210, Creature == \"None\")\n",
    "\n",
    "# Creature value is Cat\n",
    "\n",
    "CatsOnly <- filter(NoFalsePos, Creature==\"Cat\")\n",
    "\n",
    "# Creature value is Possum\n",
    "\n",
    "PossumsOnly <- filter(NoFalsePos, Creature==\"Possum\")\n",
    "\n",
    "# Creature value is Human\n",
    "\n",
    "HumansOnly <- NoFalsePos %>%\n",
    "  filter(Creature == 'Human (household)' | Creature == \"Human (non-household)\")\n",
    "\n",
    "# Creature value is Unknown\n",
    "\n",
    "CryptidsOnly <- filter(NoFalsePos, Creature==\"Unknown\")\n",
    "\n",
    "# Subset for all animals\n",
    "\n",
    "AnimalsOnly <- NoFalsePos %>%\n",
    "  filter(Creature != 'Human (household)', Creature != \"Human (non-household)\", Creature != \"Unknown\")\n",
    "\n",
    "# Since Squirrel and Raccoon sightings were only 9 observations for October,\n",
    "# We won't make subsets just yet"
   ]
