   "source": [
    "# Time to translate for human eyes\n",
    "\n",
    "AnimalsOnlySightings <- AnimalsOnly %>%\n",
    "  count(AnimalsOnly, AnimalsOnly$Creature, name = \"CreatureCount\", sort = TRUE) %>%\n",
    "  group_by(AnimalsOnly$Creature) %>%  \n",
    "  summarize(Sightings = n())\n",
    "\n",
    "# See what I meant by possum parade?\n",
    "\n",
    "AnimalsOnlySightings\n",
    "\n",
    "# Likelihood of seeing a cat per hour\n",
    "\n",
    "CatSightings <- CatsOnly %>%\n",
    "  count(CatsOnly, CatsOnly$Creature, name = \"CreatureCount\", sort = TRUE) %>%\n",
    "  group_by(CatsOnly$Hour) %>%\n",
    "  summarize(Observations = n())\n",
    "\n",
    "CatSightings\n",
    "\n",
    "# Likelihood of seeing a possum per hour\n",
    "\n",
    "PossumSightings <- PossumsOnly %>%\n",
    "  count(PossumsOnly, PossumsOnly$Creature, name = \"CreatureCount\", sort = TRUE) %>%\n",
    "  group_by(PossumsOnly$Hour) %>%\n",
    "  summarize(Observations = n())\n",
    "\n",
    "PossumSightings\n",
    "\n",
    "# Likelihood of seeing a human (!) per hour\n",
    "\n",
    "HumanSightings <- HumansOnly %>%\n",
    "  count(HumansOnly, HumansOnly$Creature, name = \"CreatureCount\", sort = TRUE) %>%\n",
    "  group_by(HumansOnly$Hour) %>%\n",
    "  summarize(Observations = n())\n",
    "\n",
    "HumanSightings"
   ]
  },
