   "source": [
    "# Now let's look at the problem child data to see if there were patterns in the corrupted observations\n",
    "# \"None\" denotes a false positive reading\n",
    "# in which the trail cam detected movement but no creature appeared in the image\n",
    "# \"Unknown\" denotes a positive reading but unrecognizeable creature\n",
    "# most often because it was small and walking directly underneath the camera\n",
    "\n",
    "# False Positives : spooky\n",
    "\n",
    "FalsePositives <- FalsePos %>%\n",
    "  count(FalsePos, FalsePos$Creature, name = \"CreatureCount\", sort = TRUE) %>%\n",
    "  group_by(FalsePos$Creature) %>%  \n",
    "  summarize(Sightings = n())\n",
    "\n",
    "FalsePositives\n",
    "\n",
    "NothingSightings <- FalsePos %>%\n",
    "  count(FalsePos, FalsePos$Creature, name = \"CreatureCount\", sort = TRUE) %>%\n",
    "  group_by(FalsePos$Hour) %>%\n",
    "  summarize(Observations = n())\n",
    "\n",
    "NothingSightings\n",
    "\n",
    "# Cryptids!!!!! \"Unknown\" creatures\n",
    "\n",
    "Cryptids <- CryptidsOnly %>%\n",
    "  count(CryptidsOnly, CryptidsOnly$Creature, name = \"CreatureCount\", sort = TRUE) %>%\n",
    "  group_by(CryptidsOnly$Creature) %>%  \n",
    "  summarize(Sightings = n())\n",
    "\n",
    "Cryptids\n",
    "\n",
    "CryptidSightings <- CryptidsOnly %>%\n",
    "  count(CryptidsOnly, CryptidsOnly$Creature, name = \"CreatureCount\", sort = TRUE) %>%\n",
    "  group_by(CryptidsOnly$Hour) %>%\n",
    "  summarize(Observations = n())\n",
    "\n",
    "CryptidSightings"
   ]
  },
