   "source": [
    "# Let's do some basic data vis on the whole group\n",
    "\n",
    "# Creature Activity by weekday\n",
    "\n",
    "NoFalsePos %>% \n",
    "  mutate(Weekday = wday(DateTimeNew, label = TRUE)) %>% \n",
    "  group_by(Creature, Weekday) %>% \n",
    "  summarize(CreatureTally = n()) %>% \n",
    "  arrange(Creature, Weekday)  %>% \n",
    "  ggplot(aes(x = Weekday, y = CreatureTally, fill = Creature)) +\n",
    "  geom_col(position = \"stack\") +\n",
    "  ggtitle(\"Most Active Day - All Creatures\")\n",
    "  \n",
    "# Creature activity by hour\n",
    "\n",
    "NoFalsePos %>% \n",
    "  group_by(Creature, Hour) %>% \n",
    "  summarize(CreatureTally = n()) %>% \n",
    "  arrange(Creature, Hour)  %>% \n",
    "  ggplot(aes(x = Hour, y = CreatureTally, fill = Creature)) +\n",
    "  geom_col(position = \"stack\") +\n",
    "  ggtitle(\"Most Active Hour - All Creatures\")"
   ]
  },
